import React, { useEffect, useRef } from 'react';

const Projects = () => {
  const projectsRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('visible');
        }
      },
      { threshold: 0.1 }
    );

    if (projectsRef.current) {
      observer.observe(projectsRef.current);
    }

    return () => {
      if (projectsRef.current) {
        observer.unobserve(projectsRef.current);
      }
    };
  }, []);

  const projects = [
    {
      title: "NYC Taxi Analysis",
      description: "Comprehensive analysis of NYC taxi trip data to identify fare patterns, tip percentages, and provide strategic business recommendations.",
      technologies: ["Python", "Pandas", "Matplotlib", "Jupyter"],
      github: "https://github.com/akshatkashyap/nyc-taxi-analysis",
      live: "#"
    },
    {
      title: "Ames Housing Analysis",
      description: "Machine learning project for housing price prediction with feature engineering and comprehensive data analysis.",
      technologies: ["Python", "Scikit-learn", "Feature Engineering", "ML"],
      github: "https://github.com/akshatkashyap/ames-housing-analysis",
      live: "#"
    },
    {
      title: "Airbnb Data Analysis",
      description: "In-depth exploration of Airbnb dataset to uncover rental trends, seasonal pricing insights, and recommendation logic.",
      technologies: ["SQL", "Tableau", "Data Visualization", "Analysis"],
      github: "https://github.com/akshatkashyap/airbnb-data-analysis",
      live: "#"
    }
  ];

  return (
    <section className="section projects" id="projects" ref={projectsRef}>
      <div className="container">
        <h2 className="section-title fade-in">Featured Projects</h2>
        <div className="projects-grid">
          {projects.map((project, index) => (
            <div key={index} className="project-card fade-in">
              <div className="project-image">
                <i className="fas fa-chart-line"></i>
              </div>
              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-description">{project.description}</p>
                <div className="project-tech">
                  {project.technologies.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">{tech}</span>
                  ))}
                </div>
                <div className="project-links">
                  <a href={project.github} target="_blank" rel="noopener noreferrer" className="project-link">
                    <i className="fab fa-github"></i> Code
                  </a>
                  <a href={project.live} className="project-link">
                    <i className="fas fa-external-link-alt"></i> Live Demo
                  </a>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
